import { GoogleLogin } from 'react-google-login'
import { Button, Icon } from 'semantic-ui-react'

const Auth = () => {
    return (
        <GoogleLogin 
            clientId=""
            render={(renderProps) => (
                <Button 
                    className={googleButton} 
                    basic color="teal"
                    fullwidth 
                    onClick={renderProps.onClick} 
                    disabled={renderProps.disabled} 
                    startIcon={<Icon name="google" />} 
                    variant="contained"
                >
                    Google Login
                </Button>
            )}
        />
    )
}

export default Auth
